window.bookSummaryJSON = "<p><b>Narrators Jacci Prior and Corvin King return with a duet narration of the exciting second volume to the Nytefall series.</b></p> <p><b>The exciting second volume in</b><i> </i><b><i>USA Today</i></b><b> bestselling author Chloe C. Peñaranda's Nytefall series, where history is doomed to repeat, and star-crossed lovers must face a choice between their hearts or the world...</b></p> <p><b><i>Vicious Nightmares Need Peaceful Dreams.</i></b></p> <p>Shaken from the aftermath of the Libertatem, the newly found star-maiden Astraea is determined to keep her freedom, even at the cost of betraying her heart. But time is running out to recover her memories with the hole it will unveil her killer.</p> <p>Embarking on a journey to discover her past, Astraea’s awakening power spins the hourglass on a history threatening to repeat itself. While Nyte tries to regain control of the vampires hungry for bloodshed, a sinister plan by his brother to overthrow him sparks a dangerous feud. But are they willing to wear the blood of their kin to see it through?</p> <p>For nothing in the past ever stays buried. Friends have turned into foes, brothers have turned into enemies, and what was written in the stars long ago ignites again in two hearts that were never meant to be. Letting Astraea go would save the world from darkness, but Nyte is no hero. It seems no monster is heartless, and no angel is without sin.</p> <p><b>A Macmillan Audio production from Bramble Books.</b></p>"; 
